import scpData from './scpData.json';

function Item({ selectedItem })
{
    console.log(selectedItem);
    return (
        <div>
            <h1>{selectedItem.ItemNum}</h1>
            <p><img src={selectedItem.image} alt={scpData.name} /></p>
            <p><strong>Class: </strong>{selectedItem.class}</p>
            <p><strong>Containment: </strong>{selectedItem.containment}</p>
            <p><strong>Description: </strong>{selectedItem.description}</p>
        </div>
    );
}

export default Item;
